#home {
  .full-width-container.step {
    background-color: var(--blue-primary);
    display: flex;
    padding: 50px;

    >h1, >div {
      display: flex;
      justify-content: center;
      flex-direction: column;
      width: 50%;
      margin-right: 30px;
      width: 50%;
    }

    >div {
      margin-left: 30px;
    }

    button {
      display: block;
      margin: 0 auto;
      color: var(--green-primary);
      border-color: var(--green-primary);
      font-size: 30px;
    }

    svg {
      max-height: 50vh;
      max-width: 60vh;
      display: block;
      margin: 0 auto;
    }

  }

  @media only screen and (max-width: 1200px) {
      .full-width-container.step {
        flex-wrap: wrap;
        >h1, >div {
          width: 100%;
          margin-bottom: 50px;
          margin-left: 0px;
        }
      }

      .full-width-container.step:nth-of-type(3) {
        flex-direction: column-reverse;
      }
  }
  @media only screen and (max-width: 750px) {
      .full-width-container.step h1 {
        font-size: 55px;
      }

      .full-width-container.step:nth-of-type(3) svg {
        height: 30vh;
      }
  }
}
